import React from 'react';
import { Container, Row, Col } from 'reactstrap';

export default class Content extends React.Component {
  render() {
    return (
      <Container fluid>
        <Row>
          <Col xs="6">
              <div>
                  <p>Result:_____________near_______________</p>
              </div>
          </Col>
          <Col xs="6">.col-6</Col>
        </Row>
      </Container>
    );
  }
}
